import React from "react";

const quality = require("../assets/quality.png").default;

const Promise = () => {
  return (
    <div className="bg-light" style={styles.card}>
      <img className="row" style={styles.icon} src={quality} />

      <p className="row">Highest Quality Standard</p>
    </div>
  );
};

const styles = {
  card: {
    width: 300,
    margin: 20,
    justifyContent: "center",
    alignItems: "center",
  },
  icon: {
    width: 40,
  },
};

export default Promise;
